import React from 'react';
import './ProgramsDetail.css';

const Athletics = () => {
  return (
    <div className="program-detail">
      <div className="program-hero" style={{ backgroundImage: `url('https://images.unsplash.com/photo-1560785496-3c9d27877182?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80')` }}>
        <div className="hero-overlay"></div>
        <div className="hero-content">
          <h1>Athletics</h1>
          <p>Competitive sports programs with professional coaching to develop teamwork and leadership skills.</p>
        </div>
      </div>
      <div className="program-content">
        <h2>About Athletics</h2>
        <p>Our Athletics program offers students the opportunity to participate in competitive sports, including soccer, basketball, track and field, and more. We focus on physical fitness, teamwork, and sportsmanship.</p>
        <img src="https://images.unsplash.com/photo-1560785496-3c9d27877182?ixlib=rb-1.2.1&auto=format&fit=crop&w=1350&q=80" alt="Athletics" />
      </div>
    </div>
  );
};

export default Athletics;
